import {useForm,useStep} from "react-hooks-helper"
import { NameAndPhone } from './steps/NameAndPhone'

const defaultData = {
    fistName:"",
    lastName:"",
    phoneNumber:"",
    email:"",
    dob:""

}

const steps = [{id:"names"},
{id:"email-addrss"},
{id:"confirmation"},
{id:"submit"}]

export const RegisterForm = () => {
    const [formData,setForm] = useForm(defaultData)
    const {step, navigation} = useStep({
        steps,
        initialStep:0
    })

    switch(step.id){
        case "names":
            return <NameAndPhone/>
    }

    return (
        <div>
            <h1>RegisterForm</h1>
        </div>
    )
}
